import {Element} from "react-scroll"

export default function Detail({etat}) {
    //state

    //comportement

    return (
        <Element name="detail">
            <div className="Detail">
                <div style={{position:"absolute"}}>
                    <h1>{etat}</h1>
                </div>
            </div>
        </Element>
    )
};
